import React from 'react';
import './footer.css';
import { TableFooter } from '@material-ui/core';

function footer() {
  return (
    <div className="footer">
      <TableFooter>
        <Tabs></Tabs>
      </TableFooter>
    </div>
  );
}

export default footer;
